import React from "react";
//import {Link} from 'react-router-dom';
import Products from '../Products/Products';
import '../App.css';

class Carts extends React.Component {



    render() { 

        const {details,onReset,onDelete,onIncrement,onDis,handelPrice}= this.props;
        return ( 
            <React.Fragment>
                <h1>Shopping Card</h1> 
                <button onClick={onReset} 
                className="btn btn-secondary btn-sm m-2">Reset</button>
                <div className="container">
                    <div className="">
                        <div className="section2">
                            <div className="products products-query prod">
                                <div className="new-pro">

                                    {details.map(one => (
                                        <Products
                                        className=""
                                        key={one.id} 
                                        onDelete={onDelete}
                                        product={one}
                                        onIncrement={onIncrement}
                                        onDis={onDis}
                                        price={handelPrice}
                                        />


                                    ))}
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        )
    }
}

export default Carts;
